import React from 'react';
import './Input.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Media from 'react-media';
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom';

// import { useNavigate } from 'react-router-dom';
// Firebase Auth for phone
// import { signInWithPhoneNumber } from "firebase/auth";
// import { auth } from '../firebase';


// Input Field form
export default function REturnInPutCode() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='form-input-eXhangeInputPhone'>
  <FormDataInput />
 </div>
);
export const ScreenSmall = () => (
 <div className='form-input-eXhangeInputPhone-sm'>
  <FormDataInput />
 </div>
);
export const FormDataInput = () => {

 const { register, handleSubmit, } = useForm({
  defaultValues: {
   phone: ''
  }
 });

 const navigation = useNavigate();

 const onSubmit = event => {
  event.preventDefault();
 };

 return (
  <form onSubmit={handleSubmit(onSubmit)}>
   <label>Numero du Compte</label>
   <input type='text' id='account' placeholder='Account' name='account' {...register('account', { required: true })} />
   <button className='Btn' >Suivant</button>
  </form>
 );
};
